pragma solidity ^0.8.0;

/**
* @title Early Stage Investor (20% -> 1.8BIL)
*
* - Distribution plan for early stage investor
* - 2-years lockup period
*
* Docs: https://docs.google.com/document/d/1booqb3pZAcEwz32JHnpq3Npwtju6UKQm/edit
*
* Version v1.1.0
*
*/

library StorageMapping {
    function value(
        mapping(bytes32 => uint256) storage map,
        string memory name
    ) internal view returns (uint256) {
        return map[keccak256(abi.encodePacked(name))];
    }

    function valueOfSender(
        mapping(bytes32 => uint256) storage map,
        string memory name, address sender
    ) internal view returns (uint256) {
        return map[keccak256(abi.encodePacked(name, sender))];
    }

    function set(
        mapping(bytes32 => uint256) storage map,
        string memory name, uint256 v
    ) internal returns (bool) {
        map[keccak256(abi.encodePacked(name))] = v;
        return map[keccak256(abi.encodePacked(name))] == v;
    }

    function setOfSender(
        mapping(bytes32 => uint256) storage map,
        string memory name, address sender, uint256 v
    ) internal returns (bool) {
        map[keccak256(abi.encodePacked(name, sender))] = v;
        return map[keccak256(abi.encodePacked(name, sender))] == v;
    }

    function value(
        mapping(bytes32 => address) storage map,
        string memory name
    ) internal view returns (address) {
        return map[keccak256(abi.encodePacked(name))];
    }

    function valueOfSender(
        mapping(bytes32 => address) storage map,
        string memory name, address sender
    ) internal view returns (address) {
        return map[keccak256(abi.encodePacked(name, sender))];
    }

    function set(
        mapping(bytes32 => address) storage map,
        string memory name, address v
    ) internal returns (bool) {
        map[keccak256(abi.encodePacked(name))] = v;
        return map[keccak256(abi.encodePacked(name))] == v;
    }

    function setOfSender(
        mapping(bytes32 => address) storage map,
        string memory name, address sender, address v
    ) internal returns (bool) {
        map[keccak256(abi.encodePacked(name, sender))] = v;
        return map[keccak256(abi.encodePacked(name, sender))] == v;
    }

    function value(
        mapping(bytes32 => bool) storage map,
        string memory name
    ) internal view returns (bool) {
        return map[keccak256(abi.encodePacked(name))];
    }

    function valueOfSender(
        mapping(bytes32 => bool) storage map,
        string memory name, address sender
    ) internal view returns (bool) {
        return map[keccak256(abi.encodePacked(name, sender))];
    }

    function set(
        mapping(bytes32 => bool) storage map,
        string memory name, bool v
    ) internal returns (bool) {
        map[keccak256(abi.encodePacked(name))] = v;
        return map[keccak256(abi.encodePacked(name))] == v;
    }

    function setOfSender(
        mapping(bytes32 => bool) storage map,
        string memory name, address sender, bool v
    ) internal returns (bool) {
        map[keccak256(abi.encodePacked(name, sender))] = v;
        return map[keccak256(abi.encodePacked(name, sender))] == v;
    }
}
